import Header from './components/Header';
import Auth from './components/Auth';
import { Fragment } from 'react';
import {useSelector} from 'react-redux';

const isAuth=useSelector(state=>state.auth.isAuthenticated);

function App() {
  return (
    <Fragment>
      <Header />
      <Auth />
      <Counter />
    </Fragment>
  );
}

export default App;
